import SearchBar from "./SearchBar";
import Page from "./Page";
import {makeStyles} from "@material-ui/core/styles";

const useStyles=makeStyles({
  root:{
    padding:"16px 0px",
    height:"90px",
    width:"100%",
    background:"grey",
    display:"flex",
    alignContent:"center",
    justifyItems:"center"
  }
});

const NavBar = (props) => {

  const classes = useStyles(props);
  return (
    <div className="root">
      <SearchBar label="Search on Google"/>
    </div>
  )
}

export default NavBar;
